import React from 'react'
import './UnitsList.css'

const UnitsList = (props) => {

  return (
    <li>
            <h2>{props.id}</h2>
            <h3>{props.name}</h3>
            <p>{props.age}</p>
        </li>
  );
};

export default UnitsList;
